    false,nt"url": null,nt"notes": "The purpose of this management plan is
    to facilitate the cooperative management of the population of greater sandhill cranes
    (Grus canadensis tabida) that winter along the lower Colorado and Gila Rivers in
    Arizona, in the Imperial Valley, California and in Baja California Norte and Sonora,
    Mexico. The goals of this management plan are to maintain the Lower Colorado River
    Valley Population of greater sandhill cranes and to provide opportunities for its
    increase and expansion within its current range. Objectives are:  A. Increase the
    population, as measured by winter surveys, from an estimated 1800-2000 cranes to
    an estimated 2400-2600 cranes by the year 2000.  B. Achieve occupancy by cranes
    of all suitable nesting habitat by 2000 without major changes in their geographic
    range, staging areas or migration corridors;  C. Achieve a dispersal of the wintering
    population by 2000u2026",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
